SELECT On_Time_On_Time_Performance_2016_1.Origin, On_Time_On_Time_Performance_2016_1.OriginWac, AVG(On_Time_On_Time_Performance_2016_1.OriginAirportSeqID) OVER (PARTITION BY On_Time_On_Time_Performance_2016_1.OriginCityMarketID ORDER BY On_Time_On_Time_Performance_2016_1.FlightNum) AS win_2, ROW_NUMBER() OVER (PARTITION BY On_Time_On_Time_Performance_2016_1.NASDelay ORDER BY On_Time_On_Time_Performance_2016_1.TailNum) AS win_3, RANK() OVER (PARTITION BY On_Time_On_Time_Performance_2016_1.Div2LongestGTime ORDER BY On_Time_On_Time_Performance_2016_1.DivReachedDest) AS win_4 FROM On_Time_On_Time_Performance_2016_1 WHERE On_Time_On_Time_Performance_2016_1.OriginState IS NOT NULL